import icon1 from '../../assets/images/global_icon.png'
import icon2 from '../../assets/images/athlete_icon.png'
import icon3 from '../../assets/images/team_icon.png'

const TILE_DATA = [
    {
        title: 'GLOBAL PARTNERSHIP',
        icon: icon1,
    },
    {
        title: 'ATHLETE PERFORMANCE DEVELOPMENT',
        icon: icon2,
    },
    {
        title: 'EXECUTIVE SUPPORT',
        icon: icon3,
    },
    {
        title: 'TEAM AND ORGANISATION REQUEST',
        icon: icon3,
    },
];

export { TILE_DATA };
